        <script>
            paper.install(window);
            var canvas = $('#myCanvas'), svg = $('#Logo');
            console.log(svg);
            paper.setup(canvas[0]);


            paper.project.importSVG(svg[0]);
            paper.view.draw();

            var lastObj = paper.project.activeLayer.children[paper.project.activeLayer.children.length - 1];
            console.log(lastObj);
            console.log(lastObj._namedChildren);
            lastObj._namedChildren.BG[0].position = new Point(0, 0);
            var x = lastObj._namedChildren.BG[0].position.x / 2;
            var y = lastObj._namedChildren.BG[0].position.y / 2;
            console.log(x);

            lastObj._namedChildren.BG[0].fullySelected = true;
            lastObj._namedChildren.Glow[0].position = new Point(-x, -y);
            lastObj._namedChildren.Glow[0].fullySelected = true;
            lastObj._namedChildren.topLayer[0].position = new Point(0, 0);
            lastObj._namedChildren.topLayer[0].fullySelected = true;


//            var children = paper.project.activeLayer.children;
//            var lastIndex = children.length - 1;
//            children[0].remove();
//            console.log(paper.project);

            var hitOptions = {
                segments: true,
                stroke: true,
                fill: true,
                tolerance: 15
            };
            var pathHit;

            var move = new Tool();
            move.onMouseDown = function(paperEvent) {
                paperEvent.preventDefault();

                var mouseHit = project.hitTest(paperEvent.point, hitOptions);
                console.log(mouseHit);
//                pathHit = mouseHit.item;
                pathHit = mouseHit.item._parent;
                pathHit.position = paperEvent.point;
//                pathHit.fillColor = 'black';
//                pathHit.strokeColor = 'red';
//                pathHit.opacity = .5;
                paper.view.draw();
            };
            move.onMouseDrag = function(paperEvent) {
                paperEvent.preventDefault();

                if(pathHit) {
                    pathHit.position = paperEvent.point;
                }

//                var mouseHit = project.hitTest(paperEvent.point, hitOptions);
//                console.log(mouseHit);

            };
